  false,\n\t\"url\": null,\n\t\"notes\": \"The Geographic Names Information System
  (GNIS), developed by the United States Geological Survey in cooperation with the
  U.S. Board of Geographic Names, provides primary information on location of all
  known places, features, and areas in the United States which are identified by a
  proper name. Specifically, information on this file is from the National Geographic
  Names Data Base, which contains names of all places, features, and areas which appear
  on the USGS 7.5-minute quadrangle map series. This version was aqcuired through
  Environmental Systems Research Institute, Inc. (ESRI).\",\n\t\"license_title\":
